import React from 'react';


import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
      minWidth: 650,
    },
  });

function createData(date, description, withdrawal, deposit, balance) {
return { date, description, withdrawal, deposit, balance};
}


const rows = [
    // createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    // createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    // createData('Eclair', 262, 16.0, 24, 6.0),
    // createData('Cupcake', 305, 3.7, 67, 4.3),
    // createData('Gingerbread', 356, 16.0, 49, 3.9),
    createData("2000/11/22", "UofT", 20000, 0 , -20000),
    createData("2000/11/12", "UBC", 30000, 0 , 0)
  ];

  export default function BasicTable(){

        const classes = useStyles();

        return(
            // <div>

            //     <h1>Entries</h1>
            //     <h2>{date}</h2>
            //     <h2>{description}</h2>
            //     <h2>{withdrawal}</h2>
            //     <h2>{deposit}</h2>
            //     <h2>{balance}</h2>


            // </div>

            <TableContainer component={Paper}>
            <Table className={classes.table} aria-label="simple table">
            <TableHead>
                <TableRow>
                <TableCell>Dessert (100g serving)</TableCell>
                <TableCell align="right">date</TableCell>
                <TableCell align="right">description&nbsp;(g)</TableCell>
                <TableCell align="right">withdrawal</TableCell>
                <TableCell align="right">deposit</TableCell>
                <TableCell align="right">balance</TableCell>

                </TableRow>
            </TableHead>
            <TableBody>
                {rows.map((row) => (
                <TableRow key={row.name}>
                    <TableCell component="th" scope="row">
                    {row.name}
                    </TableCell>
                    <TableCell align="right">{row.date}</TableCell>
                    <TableCell align="right">{row.description}</TableCell>
                    <TableCell align="right">{row.withdrawal}</TableCell>
                    <TableCell align="right">{row.deposit}</TableCell>
                    <TableCell align="right">{row.balance}</TableCell>

                </TableRow>
                ))}
            </TableBody>
            </Table>
            </TableContainer>
        );
}
